import React from 'react';
import { Route, Redirect } from 'react-router-dom';
import { rest } from 'lodash';

const RouteGuard = ({ component: Component, user, ...rest}) => {
    <Route {...rest} render={(props) => (
    props.history.location.pathname === "/login" || user
        ? <Component {...props} />
        : <Redirect to='/home' />
    ||
    console.log("else"),
    !user 
        ? <Component {...props} />
        : <Redirect to='/login' />
)} />
}


